import React from 'react';
import { Card, Label } from 'semantic-ui-react';
import { format } from 'date-fns';
import local from 'date-fns/locale/fr';
import { IAffilie } from '../../../app/models/affilie';







const MisesAjours: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {

    return (


        <div>

                {affilie.misAjours.map(Maj => Maj.rejetMajs.length > 0 ?

                    Maj.rejetMajs.map(rej => rej.corrigeRejets.length > 0 ?
                        (rej.corrigeRejets.map(corri =>

                        <Card
                            href='#card-example-link-card'
                            header={format(Maj.dateMaj, 'EEEE d MMMM yyyy', { locale: local })}
                            meta={Maj.dateMaj}
                            description={format(corri.dateCorrige, 'EEEE d MMMM yyyy', { locale: local })}
                        />)
                        ):   
                        <Card  href='#card-example-link-card'
                        header={format(Maj.dateMaj, 'EEEE d MMMM yyyy', { locale: local })}
                        meta={format(rej.dateRejet, 'EEEE d MMMM yyyy', { locale: local })}
                        description={rej.motif}>
                         < Label color='red' pointing>
                             Rejetée
                            </Label>

                        </Card>

                        ):   
                        <Card
                            href='#card-example-link-card'
                            header={format(Maj.dateMaj, 'EEEE d MMMM yyyy', { locale: local })}
                            meta={Maj.typeMaj}
                            description={Maj.info}
                        />)
                 }






        </div>


    );


}

export default MisesAjours



